import React from 'react'

import mapMarker from '../images/map-marker.svg'


function OrphamagesMap() {
    return (
        <div className="page-map">
            <aside>
                <header>
                    <img src={mapMarker} alt="" />
                </header>
            </aside>
        </div>
    )
}

export default OrphamagesMap;
